exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOption}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`http://www.unitcma.com/${bid}/${1===page?"":page+"/"}`,".section-list",{...options,clientOptions,pageSize:100,totalPagesRegex:html=>getSelectLastOption(html,s=>-1!==s.indexOf("\u7AE0"))?.subRegex(/\/\d+\/(\d+)\/?"/)?.intValue()})};